import React from 'react';
import PostForm from '../components/PostForm';
import PostCard from '../components/PostCard';

const dummy = {
  isLoggedIn: true,
  imagePaths: [],
  mainPosts: [{
    User: {
      id: 1,
      nickname: '제로초',
    },
    content: '첫 게시글',
    img: 'https://image.yes24.com/Goods/62597864/XL',
  }],
};

const Home = () => {
  return (
    <div>
      {/* 글 쓰기 */}
      {dummy.isLoggedIn && <PostForm />}

      {/* 게시글 보기 */}
      {dummy.mainPosts.map((c) => {
        return (
          <PostCard key={c} />
        )
      })}

    </div>
  );
};

export default Home;
